// src/pages/Home.js
import React from 'react';
import { Ghost, Shield, Eye } from 'lucide-react';
import { THEMES } from '../constants';

const Home = ({ username, setUsername, roomName, setRoomName, roomId, setRoomId, createRoom, setCurrentView }) => {
  const currentTheme = THEMES.default;

  return (
    <div className={`min-h-screen ${currentTheme.bg} flex items-center justify-center p-4 transition-all duration-500`}>
      <div className="max-w-md w-full space-y-8 animate-fade-in">
        <div className="text-center">
          <Ghost className="w-24 h-24 text-purple-400 mx-auto mb-4 animate-pulse-slow" />
          <h1 className="text-5xl font-bold gradient-text mb-2 tracking-tight">GhostsChat</h1>
          <p className={`${currentTheme.textSecondary} text-sm italic`}>Whisper in the Shadows • Secure • Anonymous • Free</p>
        </div>
        
        <div className={`${currentTheme.card} border rounded-2xl p-8 shadow-2xl space-y-6 transform hover:scale-105 transition-transform duration-300`}>
          <div>
            <label className={`block text-sm font-medium ${currentTheme.textPrimary} mb-2`}>
              Ghost Identity
            </label>
            <input
              type="text"
              value={username}
              onChange={(e) => setUsername(e.target.value)}
              className={`${currentTheme.input} border rounded-xl w-full px-4 py-3 focus:outline-none focus:ring-2 focus:ring-purple-500 transition-all duration-300`}
              placeholder="Choose your alias..."
              maxLength={20}
            />
          </div>
          
          <div>
            <label className={`block text-sm font-medium ${currentTheme.textPrimary} mb-2`}>
              Shadow Realm Name
            </label>
            <input
              type="text"
              value={roomName}
              onChange={(e) => setRoomName(e.target.value)}
              className={`${currentTheme.input} border rounded-xl w-full px-4 py-3 focus:outline-none focus:ring-2 focus:ring-purple-500 transition-all duration-300`}
              placeholder="Name your realm..."
              maxLength={30}
            />
          </div>
          
          <div className="space-y-4">
            <button
              onClick={createRoom}
              disabled={!username.trim() || !roomName.trim()}
              className={`${currentTheme.button} rounded-xl w-full px-4 py-3 font-medium flex items-center justify-center space-x-2 disabled:opacity-50 disabled:cursor-not-allowed transform hover:scale-105 transition-all duration-300`}
            >
              <Ghost className="w-5 h-5" />
              <span>Create Shadow Realm</span>
            </button>
            <div className="flex items-center space-x-2">
              <hr className={`flex-1 ${currentTheme.border}`} />
              <span className={`${currentTheme.textSecondary} text-sm`}>or</span>
              <hr className={`flex-1 ${currentTheme.border}`} />
            </div>
            <div className="flex space-x-2">
              <input
                type="text"
                value={roomId}
                onChange={(e) => setRoomId(e.target.value)}
                className={`${currentTheme.input} border rounded-xl flex-1 px-4 py-3 focus:outline-none focus:ring-2 focus:ring-purple-500 transition-all duration-300`}
                placeholder="Enter Room ID..."
              />
              <button
                onClick={() => setCurrentView('join')}
                disabled={!username.trim() || !roomId.trim()}
                className={`${currentTheme.buttonSecondary} rounded-xl px-4 py-3 font-medium flex items-center space-x-2 disabled:opacity-50 disabled:cursor-not-allowed`}
              >
                <Ghost className="w-5 h-5" />
                <span>Join</span>
              </button>
            </div>
          </div>
        </div>
        
        <div className="text-center space-y-2">
          <div className="flex items-center justify-center space-x-2 text-ghost-400 text-xs">
            <Shield className="w-4 h-4" />
            <span>End-to-end Encrypted</span>
          </div>
          <div className="flex items-center justify-center space-x-2 text-ghost-400 text-xs">
            <Eye className="w-4 h-4" />
            <span>No Registration Required</span>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
